import styled from "styled-components";

export const SectionStyled = styled.section`
    width: 50%;
    max-width: 380px;

    div{
        width: 100%;
        max-width: 380px;
        display: flex;
        flex-direction: column;
        align-items: flex-start;
        gap: 25px;
    }

    div > div {
        width: 95%;
        display: flex;
        flex-direction: row;
        align-items: center;
    }

    div > div > figure {
        height: 60px;
width: 60px;
left: 302px;
top: 284px;
border-radius: 5px;

    }
`
